'''
30. Substring with Concatenation of All Words

You are given a string, s, and a list of words, words, that are all of the same length. Find all starting indices of substring(s) in s that is a concatenation of each word in words exactly once and without any intervening characters.

Example 1:
Input:
  s = "barfoothefoobarman",
  words = ["foo","bar"]
Output: [0,9]
Explanation: Substrings starting at index 0 and 9 are "barfoor" and "foobar" respectively.
The output order does not matter, returning [9,0] is fine too.

Example 2:
Input:
  s = "wordgoodstudentgoodword",
  words = ["word","student"]
Output: []
'''

class Solution:
    def findSubstring(self, s, words):
        """
        :type s: str
        :type words: List[str]
        :rtype: List[int]
        """
        if not s or not words:
            return []
        w = {}
        wordLen = len(words[0])
        wordNum = len(words)
        if len(s)*wordLen < wordNum:
            return[]
        for word in words:
            if len(word) != wordLen:
                return []
            try:
                w[word] += 1
            except:
                w[word] = 1
        words = w
        wordIndex = {}
        ans = []
        for i in range(len(s)-wordLen+1):
            for word in words:
                if s[i:i+wordLen] == word:
                    wordIndex[i]=word
                    break
        for i in wordIndex:
            indexList = {}
            wordsCopy = words.copy()
            flag = True
            for j in range(wordNum):
                if (i+j*wordLen not in wordIndex) or (wordsCopy[wordIndex[i+j*wordLen]] <= 0):
                    flag = False
                    break
                else:
                    wordsCopy[wordIndex[i+j*wordLen]] -= 1
            if flag:
                ans.append(i)
        return ans
        
